    National Wildlife Refuge outlines the different projects and surveys that will help
    conserve fish and wildlife populations and habitats in their natural diversity.
    These projects include: brown bear populations and composition; caribou wintering
    population; moose composition and population survey; marine mammals survey; tundra
    swan nesting and production census; waterfowl migration survey; raptor inventory
    procedure; and seabird surveys. Study area maps and data forms are attached.",nt"owner_org":
